export const Routers = () => {
  const navigate = useNavigate();

  const handleRoute = (e) => {
    let r = e.toLowerCase();

    // Log the lowercase text to the console
    console.log(r);

    // Call the navigate function (which is not defined in the provided code)
    navigate();
  };

  return (
    <div className="nav">
      <h3> neog health </h3>

      <div className="navigation">
        <p className="nav-link" onClick={(e) => handleRoute(e)}>
          Home
        </p>
        <p>
          <Link className="nav-link" to="/exercises">
            Exercises
          </Link>{" "}
        </p>

        <p>
          {" "}
          <Link className="nav-link" to="/foods">
            Foods
          </Link>{" "}
        </p>

        <p>
          {" "}
          <Link className="nav-link p-margin" to="/goals">
            Goals
          </Link>{" "}
        </p>
      </div>
    </div>
  );
};
